import React, { Component }  from 'react';


export default class AboutContent extends Component {


    render(){
        return(
           <div>
             <h1>ESG's Misson</h1>
            <p>
            The mission of Engineering Student Government (ESG) is to represent the engineering student body in all 
            matters related to the Pratt School of Engineering. We act as a conduit between the administration and students,
            ovide support to engineering clubs and societies, and work to create a social outlet for engineers throughout the 
            academic year.
            </p>



           </div>
        ) 
    }
}
